import React from 'react'
import './Getsupport.css'
export default function Getsupport() {
    const data = [
        {
            id: "Indore",
        },
        {
            id: "Bhopal",
        },
        {
            id: "Ujjain",
        },
        {
            id: "Tikamgarh",
        },
        {
            id: "Bhopal",
        },
        {
            id: "Ujjain",
        }
    ]
    return (
        <div>
            <h1 className='logos1'>Our Centers</h1>
            <div className='cardpositioner'>
                {data.map((item,index)=>(
                    <div  key={index} className='cards'>
                    <div className='cardname'>{item.id}</div>
            </div>
                ))}
                
               
            </div>
        </div>
    )
}
